Photo by @amivitale / Elephant keeper Lemarash Kalteyo touches the ear of one of the orphans at northern Kenya’s Reteti Elephant Sanctuary (@r.e.s.c.u.e). As much as 20 percent of an elephant's body’s surface area is in their ears, which feature an intricate pattern of blood vessels. The vessels themselves can dilate, allowing them to release heat under the hot African sun. Their ears also function as fans, cooling the rest of their bodies. Follow @amivitale and @r.e.s.c.u.e to learn more, including how you can help.
